import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Switch, Route,Link} from 'react-router-dom';
import Home from ''

function App() {
  return (
    <div className="App">
      <Router><Switch><Route path='/' exact><Home/></Route></Switch></Router>
    </div>
  );
}

export default App;
